import React from 'react';
import ShopyHomeSlider from './ShopyHomeSlider';
import './Content.css';

class Content extends React.Component {
	render(){
		return (
			<div className="content-wrapper">
				<ShopyHomeSlider />
			</div>
		)
	}
}

export default Content;
